script: |
  super -f text -I q9600.spq | sort > q9600.out

inputs:
  - name: q9600.spq
    data: |
      SELECT col0 * - ( col2 ) + + cor0.col1 + - cor0.col0 * col2 AS col1 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
  - name: q9600.out
    data: |
      -347
      -3997
      -5987
